import React from "react";
import { Grid, Button } from "@material-ui/core";

function FrequentlyAskedQuestions() {
  return (
    <Grid container spacing={2}>
      <Grid item md={2}></Grid>
      <Grid item md={8}>
        <div className="mx-8">
          <h3 className="text-center">Frequently askes questions</h3>
          <p className="my-10">
            Take up questionare to help us determine if you have symptoms that
            are common for MDS and anemia. If you have common symptoms, you may
            be eligible to take part in the study.
          </p>
          <Button variant="contained" color="secondary">
            Start answering &#8594;
          </Button>
        </div>
      </Grid>
      <Grid item md={2}></Grid>
    </Grid>
  );
}

export default FrequentlyAskedQuestions;
